import React from 'react';


const Menu = () => {
  return (
    <div class="menu">
      <svg width="177px" height="161px" viewBox="0 0 177 161" version="1.1">
        <g id="Page-1" stroke="none" stroke-width="1" fill="none" fill-rule="evenodd">
          <g id="2-Desktop" transform="translate(-1263.000000, 0.000000)">
              <rect fill="#FFFFFF" x="0" y="0" width="1440" height="805"></rect>
              <g id="Icons/Menu" transform="translate(1372.000000, 40.000000)" fill="#EE5F20">
                  <g id="Group">
                      <polygon id="Rectangle-4-Copy" points="0 0 29 0 29 2 0 2"></polygon>
                      <polygon id="Rectangle-4-Copy" points="0 10 21 10 21 12 0 12"></polygon>
                  </g>
              </g>
          </g>
        </g>
      </svg>
    </div>
  );

}

export default Menu;
